export default function ProductList(){
    return(
        <>
          <section className='container-fluid mt-3'>
                  {loading?<Loader/>
                   : errorMsg ? (
                      <ErrorMsg msg={errorMsg}/>
                  ) :
                  <div className="row">
                    {items.length > 0 &&
                      items.map(item =><Products item={item} key={item.id}/>)}
                  </div>}
                  
                </section> 
        </>
    );
}
